import imaplib
import email
from email.header import decode_header
import base64


def connexion_Email(CLIENT_USER, CLIENT_MDP, SERVEUR_NAME, SERVEUR_PORT):
    """
    Permets de connecter son compte Mail et renvoi un objet mailCompte de son compte
    :param CLIENT_USER: str : Adresse mail de l'utilisateur
    :param CLIENT_MDP: str : Mot de passe de l'utilisateur
    :param SERVEUR_NAME: str : Nom du serveur de la messagerie
    :param SERVEUR_PORT: str : Numéro du serveur port de la messagerie
    :return: Un objet mail qui correspond au compte connecté
    """
    mail = imaplib.IMAP4_SSL(host=SERVEUR_NAME, port=SERVEUR_PORT)
    mail.login(CLIENT_USER, CLIENT_MDP)
    return mail


def recuperation_Email_Boite(mail, box_Name="inbox", criteria="ALL"):
    """
    Permet de récupérer les objets emails de la boite mail classé par Id
    :param mail: L'objet qui est connecté à la messagerie mail
    :param box_Name: Nom de la box où récupérer les mails (inbox : Toutes les boites)
    :param criteria: Filtre pour récupérer les mails (https://commons.apache.org/proper/commons-net/apidocs/org/apache/commons/net/imap/IMAPClient.SEARCH_CRITERIA.html)
    :return: Renvoie une liste contenant les objets emails codés en bytes
    """
    mail.select(box_Name)
    typ, messages = mail.search(None, criteria)
    email_Ids = messages[0].split()
    return email_Ids


def email_Parse(msg_Data):
    """
    Permet de decoder un e-mail, prends en entrée l'e-mail et renvoie l'entête et le corps du mail
    :param msg_Data:
    :return:
    """
    if isinstance(msg_Data, tuple):
        msg_Decode = email.message_from_bytes(msg_Data[1])

        mail_Header = []
        mail_Body = ""

        if msg_Decode.get("subject") is None:
            mail_Header_Subject = "None"
        else:
            mail_Header_Subject = decode_header(msg_Decode.get("subject"))

        if type(mail_Header_Subject[0][0]) is not str:
            try:
                mail_Header_Subject = str(mail_Header_Subject[0][0], encoding="utf-8")
            except:
                mail_Header_Subject = str(email.message_from_bytes(mail_Header_Subject[0][0]))
        else:
            mail_Header_Subject = mail_Header_Subject[0][0]

        if msg_Decode.get("From") is None:
            mail_Header_From = "None"
        else:
            mail_Header_From = decode_header(msg_Decode.get("From"))

        mail_Header.append(mail_Header_Subject)
        mail_Header.append(mail_Header_From[0][0])

        if msg_Decode.is_multipart():
            for part in msg_Decode.walk():
                if part.get_content_type() == "text/html":
                    try:
                        mail_Body = part.get_payload(decode=True)
                        mail_Body = str(mail_Body, encoding="utf-8")
                    except:
                        mail_Body = str(part.get_payload())
                    return mail_Header, mail_Body
                elif part.get_content_type() == "multipart/mixed":
                    pass
                elif part.get_content_type() == "text/plain":
                    pass
                elif part.get_content_type() == "multipart/alternative":
                    pass
                elif part.get_content_type() == "multipart/related":
                    pass
                elif part.get_content_type() == "application/pdf":
                    pass
                else:
                    print(part.get_content_type())
        else:
            if msg_Decode.get_content_charset() == "utf-8":
                mail_Body = msg_Decode.get_payload(decode=True).decode()
            else:
                mail_Body = " "

        return mail_Header, mail_Body


def decoder_Piece_Jointe(b64):
    code = base64.b64decode(b64)
    with open("pdf.pdf", "wb") as fichier:
        fichier.write(code)


def recuperer_Liste_Box_Name(mail, formatage=False):
    """
    Permet de récupérer la liste des noms de la boite mail formaté en UTF-8 ou non (Boite de reception, corbeille,
    envoyés, etc.)
    :param mail: L'objet qui est connecté à la messagerie mail
    :param formatage: Boolean : Permet de choisir si la liste doit être formatée en UTF-8
    :return: List : Renvoie une liste avec les noms de la boite mail
    """
    all_Box_Name = []
    for boxName in mail.list()[1]:
        if not formatage:
            all_Box_Name.append(boxName.decode("utf-8").split('"/" ')[1])
        else:
            all_Box_Name.append(boxName.decode("utf-8").replace("&AOk-", "é").split('"/" ')[1])
    return all_Box_Name


